webpackJsonp([56919628329280],{4304:function(e,t){e.exports={data:{markdownRemark:{html:"<h2>Git Cherry Pick</h2>\n<p>The <code>git cherry-pick</code> command applies the changes introduced by some existing commits. This guide will be focusing on explaining this feature as much as possible but of course the real <a href='https://git-scm.com/docs/git-cherry-pick' target='_blank' rel='nofollow'>Git documentation</a> will always come in handy.</p>\n<h3>Checkout an Existing Branch Cherry Pick from master</h3>\n<p>To apply the change introduced by the commit at the tip of the master branch and create a new commit with this change. Run the following command</p>\n<div class=\"gatsby-highlight\">\n      <pre class=\"language-shell\"><code>git cherry-pick master</code></pre>\n      </div>",fields:{slug:"/git/git-cherry-pick/"},frontmatter:{title:"Git Cherry Pick"}}},pathContext:{slug:"/git/git-cherry-pick/"}}}});
